import { CHANGE_YOUTUBE_URL } from './constants.js';

const initialState = {
	youtube_url: '',
}

export const change_ytURL_reducer = (state=initialState, action) => {
	switch(action.type) {
		case CHANGE_YOUTUBE_URL:
			return Object.assign({}, state, {youtube_url: action.payload.youtube_url});
		default:
			return state
	}
}
